import React, { useState, useEffect } from "react";
import axios from "axios";
import "./AddFruits.css";

export default function AddFruits() {
    const [products, setProducts] = useState([]);
    const [formData, setFormData] = useState({ itemname: "", quantity: "", unit: "", productDetails: "", refillDate: "", status: "", notes: "" });
    const [editId, setEditId] = useState(null);
    
    useEffect(() => { fetchProducts(); }, []);
    
    const fetchProducts = async () => {
        try {
            const { data } = await axios.get("http://localhost:8074/category");
            setProducts(data);
        } catch (error) { console.error("Error fetching products:", error); }
    };
    
    const handleSubmit = async (e) => {
        e.preventDefault();
        if (editId) {
            await axios.put(`http://localhost:8074/category/update/${editId}`, formData);
        } else {
            await axios.post("http://localhost:8074/category/add", formData);
        }
        resetForm();
        fetchProducts();
    };
    
    const handleDelete = async (id) => {
        await axios.delete(`http://localhost:8074/category/delete/${id}`);
        fetchProducts();
    };
    
    const handleEdit = (product) => {
        setFormData(product);
        setEditId(product._id);
    };
    
    const resetForm = () => {
        setFormData({ itemname: "", quantity: "", unit: "", productDetails: "", refillDate: "", status: "", notes: "" });
        setEditId(null);
    };
    
    return (
        <div className="container">
            <h2>Product List</h2>
            <table>
                <thead>
                    <tr>
                        <th>Item Name</th><th>Quantity</th><th>Unit</th><th>Details</th><th>Refill Date</th><th>Status</th><th>Notes</th><th>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {products.length ? products.map((p) => (
                        <tr key={p._id}>
                            <td>{p.itemname}</td><td>{p.quantity}</td><td>{p.unit}</td><td>{p.productDetails}</td>
                            <td>{p.refillDate}</td><td>{p.status}</td><td>{p.notes}</td>
                            <td>
                                <button onClick={() => handleEdit(p)}>Edit</button>
                                <button onClick={() => handleDelete(p._id)}>Delete</button>
                            </td>
                        </tr>
                    )) : <tr><td colSpan="8">No products available</td></tr>}
                </tbody>
            </table>
            
            <h2>{editId ? "Edit Product" : "Add Product"}</h2>
            <form onSubmit={handleSubmit}>
                {Object.keys(formData).map((key) => (
                    <input key={key} type="text" placeholder={key} value={formData[key]} onChange={(e) => setFormData({ ...formData, [key]: e.target.value })} />
                ))}
                <button type="submit">{editId ? "Update" : "Submit"}</button>
                {editId && <button onClick={resetForm}>Cancel</button>}
            </form>
        </div>
    );
}
